import React, { useEffect, useState } from "react";
import api from "../services/api";

const AtivoList = () => {
    const [ativos, setAtivos] = useState([]);
    const [loading, setLoading] = useState(true);
    const [searchTerm, setSearchTerm] = useState("");

    useEffect(() => {
        setLoading(true);
        api.get("ativos/")
            .then((response) => {
                setAtivos(response.data);
            })
            .catch((error) => {
                console.error("Erro ao buscar ativos:", error);
            })
            .finally(() => {
                setLoading(false);
            });
    }, []);

    const formatDate = (dateString) => {
        if (!dateString) return "-";
        return new Date(dateString).toLocaleDateString("pt-BR");
    };

    const filteredAtivos = ativos.filter((ativo) =>
        Object.values(ativo).some((value) =>
            value?.toString().toLowerCase().includes(searchTerm.toLowerCase())
        )
    );

    return (
        <div className="container mt-4">
            <div className="card">
                <div className="card-header bg-white">
                    <div className="d-flex justify-content-between align-items-center">
                        <h2 className="mb-0">Lista de Ativos</h2>
                        <div className="col-md-4">
                            <input
                                type="text"
                                className="form-control"
                                placeholder="Pesquisar ativos..."
                                value={searchTerm}
                                onChange={(e) => setSearchTerm(e.target.value)}
                            />
                        </div>
                    </div>
                </div>
                <div className="card-body">
                    {loading ? (
                        <div className="text-center py-4">
                            <div className="spinner-border text-primary" role="status">
                                <span className="visually-hidden">Carregando...</span>
                            </div>
                        </div>
                    ) : (
                        <div className="table-responsive">
                            <table className="table table-hover">
                                <thead className="table-light">
                                    <tr>
                                        <th>Nome</th>
                                        <th>Patrimônio</th>
                                        <th>Categoria</th>
                                        <th>Responsável</th>
                                        <th>Última Avaliação</th>
                                        <th>Próxima Avaliação</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {filteredAtivos.length === 0 ? (
                                        <tr>
                                            <td colSpan="6" className="text-center py-4">
                                                Nenhum ativo encontrado
                                            </td>
                                        </tr>
                                    ) : (
                                        filteredAtivos.map((ativo) => (
                                            <tr key={ativo.id}>
                                                <td>{ativo.nome}</td>
                                                <td>{ativo.codigo_patrimonio}</td>
                                                <td>{ativo.categoria}</td>
                                                <td>{ativo.responsavel}</td>
                                                <td>{formatDate(ativo.data_ultima_avaliacao)}</td>
                                                <td>{formatDate(ativo.data_proxima_avaliacao)}</td>
                                            </tr>
                                        ))
                                    )}
                                </tbody>
                            </table>
                        </div>
                    )}
                </div>
            </div>
        </div>
    );
};

export default AtivoList;
